import '../style/cardDetails.scss'; 
import circle from "../assets/circle.png"; 
const CardDetails = () => {
    return(
    <div className='cardDetail'>
        <div className='card'>
            <div className='blueLine blueTop'></div>
            <div className='blueLine blur'></div>
            <div className='cardBackground'></div>

            <div className="circleContainer">
                {/* <img src={circle}/> */}
                <div className="outerCircle outerCircle1"><div className="circle circle1"></div></div>
                <div className="outerCircle outerCircle2"><div className="circle circle2"></div></div>
                <div className="outerCircle outerCircle3"><div className="circle circle3"></div></div>
                <div className="outerCircle outerCircle4"><div className="circle circle4"></div></div>
                

                {/* <div className="circle2"></div> */}
            </div>
        </div>

        <div className='firstBlock'>

        </div>

        <div className='company'>

        </div>
    </div>)
}

export default CardDetails;
